# This is just a basic PowerShell wrapper for Alexander Leary's WheresMyImplant.dll.
# Source: https://github.com/0xbadjuju/WheresMyImplant/releases
# Note: This was hacked together for the sake of portability.
# Note: To refresh WheresMyImplant.dll do the following:
# $WMIBytes = [System.IO.File]::ReadAllBytes("C:\temp\WheresMyImplant.dll")
# $WMIString = [System.Convert]::ToBase64String($WMIBytes)
# Todo: Write wrapper functions in PowerShell, aaand maybe compress it :). In the meantime a RunCMD method example is below. Create test files and pester tests.

# The WheresMyImplant.dll
$WMIString = ""

# Grab the WheresMyImplant.dll bytes from the Base64 encoded string
$WMIBytes = [System.Convert]::FromBase64String($WMIString) 

# Load the bytes via .net Reflection
[System.Reflection.Assembly]::Load($WMIBytes)

# ----------------------------------
#  Invoke-RunCMD
# ----------------------------------
Function  Invoke-RunCMD
{
    <#
            .SYNOPSIS
            This function executes an operating system command by creating a process via .net.
            .PARAMETER Command
            This is the operating system command to be executed.
            .EXAMPLE
            PS C:\> Invoke-RunCMD -Verbose -Command "whoami"
            .EXAMPLE
            PS C:\> Invoke-RunCMD -Verbose -Command "cmd.exe" -Arguments "/c echo Hello World. > c:\temp\test2.txt"
    #>
    [CmdletBinding()]
    Param(
        [Parameter(Mandatory = $true,
        HelpMessage = 'Operating system command to be executed.')]
        [string]$Command,

        [Parameter(Mandatory = $false,
        HelpMessage = 'Arguments for the operating system command.')]
        [string]$Arguments = ""
    )

    Process
    {
        try
        {
            # Run command
            [WheresMyImplant.Implant]::RunCMD($Command,$Arguments)
        }
        catch
        {
            # Show error
            $ErrorMessage = $_.Exception.Message
            Write-Verbose -Message "$Instance : Connection Failed."
            Write-Verbose  -Message " Error: $ErrorMessage"
        }
    }
}

