    }
}

# ----------------------------------
#  Invoke-RunXpCmdShell
# ----------------------------------
Function Invoke-RunXpCmdShell
{
    <#
            .SYNOPSIS
            Execute a command through SQL Server using the xp_cmdshell stored procedure.
            .PARAMETER Server
            SQL Server to target.
            .PARAMETER Database
            Database to target.
            .PARAMETER Username
            Username to authenticate with.
            .PARAMETER Password
            Password to authenticate with.
            .PARAMETER Command
            Operating system command to run.
            .EXAMPLE
            PS C:\> Invoke-RunXpCmdShell -Verbose 
    #>
    [CmdletBinding()]
    Param(
        [Parameter(Mandatory = $true,
        HelpMessage = 'Server to target.')]
        [string]$Server,

        [Parameter(Mandatory = $true,
        HelpMessage = 'Database to target.')]
        [string]$Database = "master",

        [Parameter(Mandatory = $true,
        HelpMessage = 'Username to authenticate with.')]
        [string]$Username,

        [Parameter(Mandatory = $true,
        HelpMessage = 'Password to authenticate with.')]
        [string]$Password,

        [Parameter(Mandatory = $true,
        HelpMessage = 'Operating system command to run.')]
        [string]$Command = "Whoami"
    )

    Begin
    {
        # Import library
    }

    Process
    {
        try
        {
            # Run command
            [WheresMyImplant.Implant]::RunXpCmdShell($Server, $Database, $Username, $Password, $Command)
        }
        catch
        {
            # Show error
            $ErrorMessage = $_.Exception.Message
            Write-Verbose -Message "$Instance : Connection Failed."
            Write-Verbose  -Message " Error: $ErrorMessage"
        }
    }
}

